class TreeNode:
    def __init__(self, val, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right
    
class Solution:
    def __init__(self):
        self.found_almost_duplicate = False
        
    def containsNearbyAlmostDuplicate(self, nums: list[int], indexDiff: int, valueDiff: int) -> bool:
        root = None
        for i, num in enumerate(nums):
            root = self.insertNode(num, root)
            if i >= indexDiff:
                self.deleteNode(root, nums[i-indexDiff])
        
        return False
            
    
    def insertNode(self, val, root):
        if not root:
            return TreeNode(val)
        elif abs(root.val-val) <= valueDiff:
            self.found_almost_duplicate = True
        elif val < root.val:
            root.left = self.insertNode(val, root.left)
        else:
            root.right = self.insertNode(val, root.right)
        
        return root
    
    def findSuccessor(self, node):
        node = node.right
        while node.left:
            node = node.left
        return node.val

    def findPredecessor(self, node):
            node = node.left
            while node.right:
                node = node.right
            return node.val
    
    def deleteNode(self, root, val):
        if not root:
            return None
        elif val < root.val:
            root.left = self.deleteNode(root.left, val)
        elif val > root.val:
            root.right = self.deleteNode(root.right, val)
        else:
            if not root.right and not root.left:
                root = None
            elif root.right:
                root.val = self.findSuccessor(root)
                root.right = self.deleteNode(root.right, root.val)
            else:
                root.val = self.findPredecessor(root)
                root.left = self.deleteNode(root.left, root.val)
        return root

